import React from 'react';

function Footer() {
  return (
    <div padding={8}>
      <div>
        <div>
          Powered by Redis and Golang
          </div>
      </div>
      <div>
        <div  size="sm" paddingTop={2}>
          Made by{' '}
          <a href="https://github.com/dmytrodemianchuk" rel="noreferrer" target={'_blank'}>
            Dmytro Demianchuk
          </a>
        </div>
      </div>
    </div>
  );
}

export default Footer;
